void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void swap(int* x, int* y){
    int temp = *y;
    *y = *x;
    *x = temp;
}

void draw_line(int x0, int y0, int x1, int y1, int color){
    int is_steep = ABS(y1 - y0) > ABS(x1 - x0);
    if(is_steep){
        swap(&x0, &y0);
        swap(&x1, &y1);
    }
    if(x0 > x1){
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int deltax = x1 - x0;
    int y_step;
    int deltay = ABS(y1 - y0);
    int error = -(deltax / 2);
    int y = y0;
    if(y0 < y1)
        y_step = 1;
    else
        y_step = -1;
    
	if(deltax > 0){
		for(int i = x0; i < x1 + 1; i++){
			if(is_steep)
				plot_pixel(y, i, color);
			else
				plot_pixel(i, y, color);
			error = error + deltay;
			if(error > 0 || error == 0){
				y = y + y_step;
				error = error - deltax;
			}
		}
	}
}
void wait_for_vsync(){
    volatile int *ctrl_ptr = (int*)0xFF203020;
    int status;
    *ctrl_ptr = 1;
    status = *(ctrl_ptr + 3);
    while((status & 0x01) != 0){
        status = *(ctrl_ptr + 3);
    }
}



