void clear_screen(){

    for (int i = 0; i < RESOLUTION_X ; i++){
        for (int j = 0; j < RESOLUTION_Y ; j++){
            *(short int *)(pixel_buffer_start + (j << 10) + (i << 1)) = 0x0;
        }
    }
}
void clear_animation_box(){
    for (int i = ANIMLOCX; i < ANIMATIONRESX+ANIMLOCX ; i++){
        for (int j = ANIMLOCY; j < ANIMATIONRESY+ANIMLOCY ; j++){
            *(short int *)(pixel_buffer_start + (j << 10) + (i << 1)) = 0x0;
        }
    }
}

