void draw(int resx, int resy, int offsetx, int offsety, int* img){
    for(int x = 0; x < resx; x++){
        for(int y = 0; y < resy; y++){
            if(img == NULL)
              *(short int *)(pixel_buffer_start + ((y + offsety) << 10) + ((x + offsetx) << 1)) = 0;
            else
              *(short int *)(pixel_buffer_start + ((y + offsety) << 10) + ((x + offsetx) << 1)) = img[resx*y + x];
        }
    }
}

